import '../pages/styler.css'


const layout = (props)=>(
    <div>
        
        <head>
            <title>the brongondyte</title>
            <link rel="stylesheet" href="./style/styler.min.css"/>
        </head>
        <Navbar/>
        {props.children}
    </div>
)


export default layout;
